  \"2015-11-18T09:34:30.819659\",\n\t\"name\": \"u-s-forest-service-withdrawal\",\n\t\"isopen\":
  true,\n\t\"url\": null,\n\t\"notes\": \"A map service on the www depicting federal
  land parcels that are withdrawn from settlement, sale, location, or entry under
  some or all of the general land and mineral laws in order to maintain other public
  values or purposes. A withdrawal area has one or more associated segregations. A
  segregation is a specific activity from which the area has been withdrawn such as
  settlement, sale, location, or entry. The purpose of the data is to provide display,
  identification, and analysis tools for determining current boundary information
  for Forest Service managers, GIS Specialists, and others.\",\n\t\"license_title\":
